import React, { useState } from 'react';
import { View, Text, Button, StyleSheet } from 'react-native'


const Todo = (props) => {
    return (
        <View>
        <Text>
            {props.name}
        </Text>

        </View>
    )
}

const styles = StyleSheet.create({
    item:{
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center',
        borderColor: 'grey',
        borderWidth: 1,
        borderRadius: 5,
        backgroundColor: 'whitesmoke'


    },
    align: {
        alignSelf: 'center'
    },
    font: {
        fontSize: 20,
        fontWeight: 'bold'

    }

})
export default Todo;
